import React, { Component } from 'react';


class Register extends Component{

    constructor(props){
        super(props);

        this.state = {
            firstName:"",
            lastName:"",
            email:"",
            password:"",
            confirmPassword:"",
            valid:false
        }

        this.getFirstName= this.getFirstName.bind(this)
        this.getLastName= this.getLastName.bind(this)
        this.getEmail= this.getEmail.bind(this)
        this.getPassword= this.getPassword.bind(this)
        this.getConfirmPassword= this.getConfirmPassword.bind(this)
    }

    getFirstName=(e)=>{
        console.log("input",e.target.input)
        this.setState({firstName:e.target.input})
        console.log("firstname",this.state.firstName)
    }

    getLastName= (e)=>{
        console.log("input",e.target.input)
        this.setState({lastName:e.target.input})
        console.log("lastname",this.state.lastName)
    }

    getEmail= (e)=>{
        console.log("input",e.target.input)
        this.setState({email:e.target.input})
        console.log("email",this.state.email)
    }

    getPassword= (e)=>{
        console.log("input",e.target.input)
        this.setState({password:e.target.input})
        console.log("password",this.state.password)
    }

    getConfirmPassword= (e)=>{
        this.setState({confirmPassword:e.target.input})
        console.log("input",e.target.input)
        console.log("confirm password",this.state.confirmPassword)
    }

    submit = ()=>{
        console.log("firstname",this.state.firstName)
        console.log("lastname",this.state.lastName)
        console.log("email",this.state.email)
        console.log("password",this.state.password)
        console.log("confirm password",this.state.confirmPassword)
    }


    render(){
        return (
            <form>
                <label>
                 First Name:
                <br/>
                <input type="text" onChange={this.getFirstName}/>
                <br/>
                 Last Name:
                <br/>
                <input type="text" onChange={this.getLastName}/>
                <br/>
                Email:
                <br/>
                <input type="text" onChange={this.getEmail}/>
                <br/>
                Password:
                <br/>
                <input type="password" onChange={this.getPassword}/>
                <br/>
                Confirm Password:
                <br/>
                <input type="password" onChange={this.getConfirmPassword}/>
                </label>
                <br/>
                <input type="submit" value="Submit" onClick={this.submit}/>
            </form>
        )
    }
}

export default Register;
